import UserPage from './src/components/pages/UserPage';
import HomePage from './src/components/pages/HomePage';
import LoginPage from './src/components/pages/LoginPage';
import RegisterPage from './src/components/pages/RegisterPage';
import { StyleSheet, View } from 'react-native';
import TransferPage from './src/components/pages/TransferPage';
import { NavigationContainer } from '@react-navigation/native';
import { createNativeStackNavigator } from '@react-navigation/native-stack';

const Stack = createNativeStackNavigator();

export default function App() {
  return (
    <View style={styles.container}>
      <NavigationContainer>
          <Stack.Navigator screenOptions={{ headerShown: ture }} initialRouteName="Home">
            <Stack.Screen name="Login" component={LoginPage} />
            <Stack.Screen name="User" component={UserPage} />
            <Stack.Screen name="Transfer" component={TransferPage} />
            <Stack.Screen name="Register" component={RegisterPage} />
            <Stack.Screen name="Home" component={HomePage} />
          </Stack.Navigator>
      </NavigationContainer>
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#fff',
    alignItems: 'center',
    justifyContent: 'center',
  },
});
